import { Carousel, Image } from 'antd';
import React from 'react';

function Home() {

  const carouselBS: React.CSSProperties = {
    width: '100vw',
    height: '100vh',
    position: 'relative',
  };

  const carouselS: React.CSSProperties = {
    
  };

  const carouselCS: React.CSSProperties = {
    
    position: 'absolute',
  };

  const carouselConfig = {
    autoplay: true,
  };

  return (<>
    <div style={carouselBS}>
      <Carousel style={carouselS} {...carouselConfig}>
        <div>
          <img className='w-100 h-100' src='/images/carousel-1.jpg' />
        </div>
        <div>

        </div>
      </Carousel>
      <div style={carouselCS}>

      </div>
    </div>
  </>);
}
export default Home;
